import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div className="flex flex-col items-center justify-center h-screen bg-cover bg-center bg-no-repeat" style={{ backgroundImage: "url(background.jpg)" }}>
      <h1 className="text-4xl font-bold text-white mb-4">Wisata Pulau Seribu</h1>
      <p className="text-xl text-white text-center mb-6">Discover Paradise at Thousand Islands: Your Ultimate Travel Destination!</p>
      <Link to="/destinations" className="bg-blue-500 hover:bg-blue-600 text-white font-semibold py-2 px-4 rounded">
        Let's go now!
      </Link>
    </div>
  );
};

export default Home;
